import React from "react";
import "./Country.css";

export default function Country({flag, name, continent}) {
    return [
        <div className="country">
            <img src={flag} alt="img not found"/>
            <h3>{name}</h3>
            <h5>{continent}</h5>
        </div>
    ]
}
